@avalron El problema de cuando partes de una premisa falsa , es que tus conclusiones también lo serán ,Avalron .
Jamás fue objetivo de Rusia ,  apoderarse de Ucrania .
Tampoco dijo que en días o meses o años . Sólo es un operativo con objetivos oncretos y precisos . El asunto se complicó ,cuando EEUU y Europa metieron sus manos ,enviando hombres , armamento y dineros . Ahora ,Avalron ,ya tenemos claro que es EEUU y sus mascotas europeas quienes están lidiando contra Rusia .

